extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);
  int pg_num = fdp.ConsumeIntegral<int>();
  double hdpi = fdp.ConsumeFloatingPoint<double>();
  double vdpi = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeBool();
  GBool crop = fdp.ConsumeBool();
  GBool printing = fdp.ConsumeBool();

  char payload[1024];
  memset(payload, 0, sizeof(payload));
  std::vector<uint8_t> remaining_bytes = fdp.ConsumeRemainingBytes<uint8_t>();
  memcpy(payload, remaining_bytes.data(), remaining_bytes.size());

  Object xpdf_obj;
  xpdf_obj.initNull();
  BaseStream *stream = new MemStream(payload, 0, sizeof(payload), &xpdf_obj);

  Object info, xfa;
  Object *acroForm;
  globalParams = new GlobalParams(NULL);
  globalParams->setErrQuiet(1);
  globalParams->setupBaseFonts(NULL);
  char yes[] = "yes";
  globalParams->setEnableFreeType(yes);
  globalParams->setErrQuiet(1);
  PDFDoc *doc = NULL;
  try {
    doc = new PDFDoc(stream, new GString("/tmp/"), new GString("/tmp/"));
    if (doc->isOk() == gTrue) {
      SplashColor paperColor = {0xff, 0xff, 0xff};
      SplashOutputDev *splashOut = new SplashOutputDev(splashModeRGB8, 1, gFalse, paperColor);
      splashOut->setNoComposite(gTrue);
      splashOut->startDoc(doc->getXRef());
      const int num_pages = doc->getNumPages();

      if (pg_num > 0 && pg_num <= num_pages) {
          doc->displayPages(splashOut, pg_num, pg_num, hdpi, vdpi, rotate, useMediaBox, crop, printing, NULL, NULL);
      }

      delete splashOut;
    }
  } catch(...) {
  }

  delete doc;
  delete globalParams;
  xpdf_obj.free();
  return 0;
}

